import { SdkManager } from './sdkManager';
export class SdkManagerBuilder {
    static create() {
        return new SdkManagerBuilder();
    }
    addResiliencyConfiguration(resiliencyConfiguration) {
        this.resiliencyConfiguration = resiliencyConfiguration;
        return this;
    }
    addAuthClient(authClient) {
        this.authClient = authClient;
        return this;
    }
    addApsConfiguration(apsConfiguration) {
        this.apsConfiguration = apsConfiguration;
        return this;
    }
    addLogger(logger) {
        this.logger = logger;
        return this;
    }
    build() {
        return SdkManager.getInstance(this.apsConfiguration, this.resiliencyConfiguration, this.authClient, this.logger);
    }
}
